import React from "react";
const style = {
    position: 'absolute',
    top: 0,
    left: 0,
    backgroundColor: "rgb(43 42 42)",
    width: '100%',
    height: '100%',
    color: '#fff'
}

const Loading = (props) => {
    return (
        <h1 style={style}>{props.message === 'Error'}</h1>
    )
}

export default Loading;
